import React from 'react';

function About() {
  return (
    <section id="about" className="about">
      <h2>About Me</h2>
      <p>
      Hello! I’m Nityanand, a passionate technologist with a love for all things data.My journey began with a simple fascination with video games, which sparked a curiosity about how computers work. This curiosity grew into a deep dive into the world of technology, leading me to pursue both a Bachelor’s and a Master’s degree in the field.

Over the years, I’ve explored a wide range of tech domains, but my heart lies in the realm of data. From Data Analytics to Data Engineering, Data Science, and Machine Learning, I’m captivated by the power of data to tell stories and drive decisions. Add to that my interest in AI and Cloud technologies, and you’ve got someone who’s constantly excited about shaping the future with innovative solutions.
      </p>
    </section>
  );
}

export default About;
